import React from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import "./App.css";
import HomePage from "./pages/HomePage";
import CodeEditorPage from "./pages/CodeEditorPage";
import PortfolioPage from "./pages/PortfolioPage";
import StrategyManagementPage from "./pages/StrategyManagementPage";

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navigation">
          <Link to="/">Home</Link>
          <Link to="/code-editor">Code Editor</Link>
          <Link to="/portfolio">Portfolio</Link>
          <Link to="/strategy-management">Strategy Management</Link>
        </nav>
        <Switch>
          <Route path="/" exact component={HomePage} />
          <Route path="/code-editor" component={CodeEditorPage} />
          <Route path="/portfolio" component={PortfolioPage} />
          <Route path="/strategy-management" component={StrategyManagementPage} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
